window.bookSummaryJSON = "<p>My gloves are coming off.... </p> <p>The Collectors haven't only made my life a living hell; they've made a game out of tormenting everyone I love. </p> <p>And I refuse to stand for it any longer. </p> <p>I'm committed to using all of the tools at my disposal to end their reign of terror - even if that means collecting every psychic ability I can get my hands on. </p> <p>With Jameson, Noah, Mason, and Stowe by my side, and in my heart, I finally believe in myself and my abilities. </p> <p>My name is Adele Rose, and I'm ready to embrace my fate. </p> <p>Contains mature themes.</p>"; 
